import React from 'react';
import { FiDroplet, FiLayout, FiTool } from 'react-icons/fi';
import '../styles/services.css';

const services = [
  {
    id: 1,
    Icon: FiLayout,
    title: "Custom Design",
    description: "Tailored pool solutions",
    gradient: "linear-gradient(135deg, #E0F7FA 0%, #B2EBF2 50%, #80DEEA 100%)"
  },
  {
    id: 2,
    Icon: FiTool,
    title: "Professional Installation",
    description: "Precision craftsmanship",
    gradient: "linear-gradient(135deg, #E1F5FE 0%, #B3E5FC 50%, #81D4FA 100%)"
  },
  {
    id: 3,
    Icon: FiDroplet,
    title: "Maintenance",
    description: "Crystal clear perfection",
    gradient: "linear-gradient(135deg, #E0F7FA 0%, #80DEEA 50%, #4DD0E1 100%)",
    waterEffect: true
  }
];

const ServiceIcons = () => {
  return (
    <div className="services-grid">
      {services.map((service) => (
        <div key={service.id} className="service-card">
          <div 
            className={`icon-wrapper ${service.waterEffect ? 'water-effect' : ''}`}
            style={{ background: service.gradient }}
          >
            <service.Icon className="service-icon" />
          </div>
          <h3>{title}</h3>
          <p>{description}</p>
        </div>
      ))}
    </div>
  );
};

export default ServiceIcons;
